package com.skogen.coin.screens.main.menu_screen.fragment.presentation.presenter

import com.skogen.coin.models.MenuMealModel
import com.skogen.coin.screens.main.menu_screen.fragment.presentation.view.MenuView
import com.skogen.coin.skeleton.presentation.BasePresenter

class MenuPresenter(override val view: MenuView) : BasePresenter() {

    fun init() {}

    fun getMenu() {
        var menuList: ArrayList<MenuMealModel> = ArrayList()
        menuList.add(MenuMealModel("1", "Bakt Potet - 150 g", 130, "1",
                "meal", "data:image/jpeg;base64,",
                "Nydelig bakt potet uten like. Fersk og God slik det burde være."))

        menuList.add(MenuMealModel("2", "Pizza - 1 Stk", 60, "1",
                "meal", "https://ichef.bbci.co.uk/food/ic/food_16x9_832/recipes/alpine_pizza_32132_16x9.jpg",
                "Rykende fersk pizza, rett fra ovnen, til deg."))

        if (menuList.isNotEmpty())
            view.setMenuItems(menuList)
        else
            view.setEmptyState()
    }
}
